import React from 'react';

import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

import './App.css';


function App() {
  return (
    <Container>
      <Row>
        <h1>This is My Website</h1>
      </Row>
    </Container>
  );
}

export default App;
